Django 提供了多種 Field 的定義方式，以下是一些常見的 Field 的定義方式： CharField : 用於存儲字符串數據。 name = models.CharField(max_length=100) TextField : 用於存儲大量文本數據。 description = models.TextField() IntegerField : 用於存儲整數數據。 age = models.IntegerField() DateTimeField : 用於存儲日期和時間數據。 created_at = models.DateTimeField(auto_now_add=True) BooleanField : 用於存儲布爾值（True/False）。 is_active = models.BooleanField(default=True) FloatField : 用於存儲浮點數數據。 price = models.FloatField() EmailField : 用於存儲電子郵件地址。 email = models.EmailField() URLField : 用於存儲網址。 website = models.URLField() Field 選項 : 每個字段都可以有一組選項來控制其行為。以下是一些常見的字段選項： null: 如果為 True，則允許欄位的空值為NULL。 name = models.CharField(max_length=100, null=True) blank: 如果為 True，則允許欄位的空值。 name = models.TextField(max_length=100, blank=True) default: 如果欄位未被填寫，則允許欄位的預設值。 is_active = models.BooleanField(default=True) unique: 如果為 True，則允許欄位的值僅能在資料庫中唯一。 email = models.EmailField(unique=True) choices: 如果欄位的值可以從一組可選值中選擇，則可以使用 choices 選項。 COLOR_CHOICES = [ ('red', 'Red'), ('green', 'Green'), ('blue', 'Blue')
]
color = models.CharField(max_length=100, choices=COLOR_CHOICES)

