簡單的基於函數的視圖示例： from django.http import HttpResponse def my_view(request): return HttpResponse("Hello, world!") 使用模板 可以使用 Django 模板來生成 HTML 響應： from django.shortcuts import render def my_view(request): context = {'message': 'Hello, world!'} return render(request, 'my_template.html', context) 處理表單數據 在視圖中處理表單數據： from django.http import HttpResponseRedirect
from django.shortcuts import render
from .forms import MyForm def my_view(request): if request.method == 'POST': form = MyForm(request.POST) if form.is_valid(): # 處理表單數據 return HttpResponseRedirect('/success/') else: form = MyForm() return render(request, 'my_template.html', {'form': form})

