在你的 Django 項目中，你需要配置 Django Ninja。以下是基本配置步驟： 添加到 INSTALLED_APPS： 雖然不是必須的，但你可以將 ninja 添加到你的 INSTALLED_APPS 中： # settings.py
INSTALLED_APPS = [ ... 'ninja',
] 創建 API 模塊 在你的 Django 項目中創建一個 api.py 文件來定義你的 API 端點。 # api.py
from ninja import NinjaAPI api = NinjaAPI() @api.get("/hello")
def hello(request): return {"message": "Hello, world!"} 配置 URL 在 urls.py 文件中配置 API 的 URL 路徑。 # urls.py
from django.urls import path
from .api import api urlpatterns = [ path("api/", api.urls),
] 運行 API 啟動 Django 開發伺服器來運行你的 API： python manage.py runserver
